import htmlFoto from './htmlft.png';
import './specifications.css';

function Especificacoes () {
    return(

<div className="especificacaoes">

    <div className="esp-content">

     <div className="esp-1">HTML CSS
   
     </div>

     <div className="esp-2">JAVA SCRIPT
     </div>

     <div className="esp-3">REACT
     </div>

